import React from "react";
//import CourseList from "../component/CourseList.jsx";
//import AccountInfo from "../component/AccountInfo.jsx";
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";

function Tutorial() {
  return (
    <div>
      intruduction of this app
      <p>
        you can login first, and put your courses, your questions and your
        answers here
      </p>
    </div>
  );
}

class HomepageGuide extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        {/* 编写路由导航 */}
        <ul>
          <li>
            <Link to="/">首页</Link>
          </li>
          <li>
            <Link to="/classes">课程</Link>
          </li>
          <li>
            <Link to="/mine">我的</Link>
          </li>
          <li>
            <Link to="/mineaaaa">没有的组件</Link>
          </li>
        </ul>
        {/* 路由配置 */}
        <Switch>
          <Route exact path="/" component={Home}></Route>
          <Route path="/classes" component={Classes}></Route>
          <Route path="/mine" component={Mine}></Route>
          {/* 配置404组件 */}
          <Route component={Notfound}></Route>
        </Switch>
      </div>
    );
  }
}

export default class Home extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <>
        <div>
          <header>Home Page</header>
        </div>
        <hr />
        <Tutorial />
        <BrowserRouter>
          <HomepageGuide />
        </BrowserRouter>
      </>
    );
  }
}
function Mine() {
  return (
    <ul>
      <li>Name</li>
      <li>Account Number</li>
      <li>Password</li>
    </ul>
  );
}

function Classes() {
  return (
    <ul>
      <li>react</li>
      <li>java script</li>
      <li>redux</li>
    </ul>
  );
}
